const users = {
  state: {
    users: [
      { username: "user", password: "user", role: "client" },
      { username: "manager", password: "manager", role: "manager" },
      { username: "admin", password: "admin", role: "admin" },
    ],
  },
  mutations: {},
  actions: {},
  getters: {},
};

export default users;
